local Players = game:GetService("Players")
local HttpService = game:GetService("HttpService")
local LocalPlayer = Players.LocalPlayer
local username = LocalPlayer.Name

local keyURL = "https://raw.githubusercontent.com/Skyzee02/skntlxxnxxnxxnxxnxx01/refs/heads/main/key.json"


local function DurationToSeconds(duration)
    duration = string.lower(duration)

    if duration == "lifetime" then
        return math.huge
    elseif duration:find("days") then
        local days = tonumber(duration:match("(%d+)"))
        if days then
            return days * 24 * 60 * 60
        end
    elseif duration:find("day") then
        local days = tonumber(duration:match("(%d+)"))
        if days then
            return days * 24 * 60 * 60
        end
    end

    -- default → 0 (langsung expired)
    return 0
end



local success, data = pcall(function()
    return game:HttpGet(keyURL)
end)

if not success then
    LocalPlayer:Kick("❌ Failed to load key database.")
    return
end

local keyList
pcall(function()
    keyList = HttpService:JSONDecode(data)
end)

if not keyList or typeof(keyList) ~= "table" then
    LocalPlayer:Kick("❌ Invalid key database format.")
    return
end


local isWhitelisted = false
local matchedKey = nil
local matchedCreatedAt = nil
local matchedDuration = nil

for _, keyData in ipairs(keyList) do
    if keyData.whitelist then
        for _, allowedUser in ipairs(keyData.whitelist) do
            if string.lower(allowedUser) == string.lower(username) then
                isWhitelisted = true
                matchedKey = keyData.key
                matchedCreatedAt = keyData.created_at
                matchedDuration = keyData.duration
                break
            end
        end
    end
end

if not isWhitelisted then
    LocalPlayer:Kick("❌ You are not whitelisted to use this script.")
    return
end


local function ISO8601_to_unix(iso)
    if not iso or typeof(iso) ~= "string" then
        return nil
    end
    
    local year, month, day, hour, min, sec =
        iso:match("(%d+)%-(%d+)%-(%d+)T(%d+):(%d+):(%d+)")

    if not year then
        return nil
    end

    return os.time({
        year = tonumber(year),
        month = tonumber(month),
        day = tonumber(day),
        hour = tonumber(hour),
        min = tonumber(min),
        sec = tonumber(sec)
    })
end

if not matchedDuration or not matchedCreatedAt then
    LocalPlayer:Kick("❌ Key invalid: missing duration or created_at.")
    return
end

local createdUnix = ISO8601_to_unix(matchedCreatedAt)

if not createdUnix then
    LocalPlayer:Kick("❌ Invalid created_at format in key: " .. matchedKey)
    return
end

local durationSeconds = DurationToSeconds(matchedDuration)
local now = os.time()

local expireTime = createdUnix + durationSeconds

if durationSeconds ~= math.huge and now > expireTime then
    LocalPlayer:Kick("❌ Your key has expired.\nKey: " .. matchedKey)
    return
end

print("✔ WHITELIST OK:", username)
print("✔ KEY TYPE:", matchedKey)

if durationSeconds == math.huge then
    print("✔ EXPIRE DATE: Lifetime")
else
    print("✔ EXPIRE DATE:", os.date("%Y-%m-%d %H:%M:%S", expireTime))
end

